import React, { useState } from "react";
import { View, Text, TextInput, TouchableOpacity, StyleSheet } from "react-native";
import { useNavigation } from "@react-navigation/native";



const CreateAccount = ({ navigation }) => {

    return (

        <View style={style.container}>
        <View style={style.topBar}>
            <Text>Create Account</Text>
            <Text>Fill your information below or register with your social account</Text>

        </View>
        <View style={style.centerArea}>
            <TextInput style={styles.field} placeholder="Your Name"></TextInput>
            <TextInput style={styles.field} placeholder="MM/DD/YYYY"></TextInput>
            <TextInput style={styles.field} placeholder="Enter Your Location"></TextInput>
            <TextInput style={styles.field} placeholder="+1"></TextInput>

            <TouchableOpacity>
                <Text>NextS</Text>
            </TouchableOpacity>
        </View>

        <View style={style.footer}>
            <TouchableOpacity>
                <Text style={{ color: "#C4C4C4" }}>-- Or sign in with --</Text>
            </TouchableOpacity>



        </View>



    </View>
)

}


const style = StyleSheet.create({
container: {
    backgroundColor: "#FFFFFF",
    alignItems: 'center',
    justifyContent: 'flex-start',
    width: 375,
    height: 850,

}
});

export default CreateAccount();
